import MyNavbar from './components/navbar'
import './App.css'
import Daytracker from './components/daytracker';
import Quotes from './components/quotes';
import DailyKalorien from './components/calorieTracker';

function App() {
  return (
      <div>
        <div className='header'>
        <Daytracker />
        <Quotes />
        <MyNavbar />
      </div>
      <div className='main'>
        <DailyKalorien />
      </div>
      </div>
  );
}

export default App;
